import React, { Component, Fragment } from 'react'
import Header from '../../components/Header';
import './contact.css'
import ContactForm from '../../components/ContactForm/ContactForm';


export default class Contact extends Component {
  render() {
    return (
      <Fragment>
      <Header/>
      <div className="p-6">
        <h1 className='text-center lg:text-4xl md:text-3xl sm:text-2xl font-bold pb-5'>Contact Us</h1>
        <p className='font-semibold text-justify lg:text-lg md:text-md pb-5'>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Lorem ipsum dolor sit, amet consectetur adipisicing elit. Eaque, sit. Corrupti libero error quibusdam ad. Nihil reprehenderit odio inventore mollitia ducimus ipsa animi cupiditate beatae ipsum impedit quidem, dolore officia. Lorem ipsum dolor sit amet consectetur adipisicing elit. Ex, debitis consequuntur, ad magnam quam sit quas perspiciatis alias nemo laudantium cumque asperiores minima sed nulla illo pariatur. Expedita, voluptate soluta. Lorem ipsum dolor sit amet.</p>
        <div className='bg-white rounded-lg shadow-sm grid grid-col-4 gap-4'>
            <ContactForm/>
        </div>
      </div>
      </Fragment>
    );
  }
}
